import Header from './components/Header'
import Nav from './components/Nav'
const App = () => {
  return(
      <div className='site-wrapper'>
        <Header/>
        <Nav/>
        <div className='content'>
          <img src='https://www.old-games.ru/games/pc/postal/covers/146_5e5bceebe9096.jpg'/>
        </div>
      </div>
  );

}

export default App;
